"use strict";(self.webpackChunkdyte_docs=self.webpackChunkdyte_docs||[]).push([[1622],{6633:e=>{e.exports=JSON.parse('{"version":{"pluginId":"android","version":"current","label":"Pro","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Fleet Stack Pro App User Guide","href":"/Fleet-Stack-Pro/","docId":"A-Fleet-Stack_Pro-Mobile-App-Guide","unlisted":false},{"type":"link","label":"Log In","href":"/Fleet-Stack-Pro/Log-In","docId":"Log-In","unlisted":false},{"type":"link","label":"Dashboard Overview","href":"/Fleet-Stack-Pro/Dashboard-Overview","docId":"Dashboard-Overview","unlisted":false},{"type":"link","label":"Map and Features","href":"/Fleet-Stack-Pro/Map-Features","docId":"Map-Features","unlisted":false},{"type":"link","label":"Map and Features","href":"/Fleet-Stack-Pro/Map-Settings","docId":"Map-Settings","unlisted":false},{"type":"link","label":"Navigate","href":"/Fleet-Stack-Pro/Navigate","docId":"Navigate","unlisted":false},{"type":"link","label":"Parking Mode","href":"/Fleet-Stack-Pro/Parking-Mode","docId":"Parking-Mode","unlisted":false},{"type":"link","label":"Remotely Immobilize Vehicle","href":"/Fleet-Stack-Pro/Remotely-Immobilize-Vehicle","docId":"Remotely-Immobilize-Vehicle","unlisted":false},{"type":"link","label":"Vehicle Details","href":"/Fleet-Stack-Pro/Vehicle-Details","docId":"Vehicle-Details","unlisted":false},{"type":"link","label":"Vehicle List","href":"/Fleet-Stack-Pro/Vehicle-List-and-Details","docId":"Vehicle-List-and-Details","unlisted":false},{"type":"link","label":"Reports","href":"/Fleet-Stack-Pro/Reports-and-Analysis","docId":"Reports-and-Analysis","unlisted":false},{"type":"link","label":"Replay Feature","href":"/Fleet-Stack-Pro/Replay-Feature","docId":"Replay-Feature","unlisted":false},{"type":"link","label":"Advanced Features","href":"/Fleet-Stack-Pro/Advanced-Vehicle-Features","docId":"Advanced-Vehicle-Features","unlisted":false},{"type":"link","label":"Tracking Link Creation","href":"/Fleet-Stack-Pro/Tracking-Link-Creation","docId":"Tracking-Link-Creation","unlisted":false},{"type":"link","label":"Notification Settings","href":"/Fleet-Stack-Pro/Notifications-Settings","docId":"Notifications-Settings","unlisted":false},{"type":"link","label":"Geofencing","href":"/Fleet-Stack-Pro/Geofencing","docId":"Geofencing","unlisted":false},{"type":"link","label":"Support and Feedback","href":"/Fleet-Stack-Pro/Support-and-Feedback","docId":"Support-and-Feedback","unlisted":false}]},"docs":{"A-Fleet-Stack_Pro-Mobile-App-Guide":{"id":"A-Fleet-Stack_Pro-Mobile-App-Guide","title":"Fleet Stack Pro App User Guide","description":"\\"Unlock the full potential of the Fleet Stack Mobile App with this comprehensive guide, offering step-by-step instructions to help you optimize your fleet operations with ease.\\"","sidebar":"tutorialSidebar"},"Advanced-Vehicle-Features":{"id":"Advanced-Vehicle-Features","title":"Advanced Features","description":"The Advanced Features section allows you to make the most out of your Fleet Stack app by using powerful tools to track vehicles, control engines, and manage parking notifications. Whether you\'re looking to monitor vehicles remotely, control their status, or get real-time alerts, these features will help you stay informed and in control.","sidebar":"tutorialSidebar"},"Dashboard-Overview":{"id":"Dashboard-Overview","title":"Dashboard Overview","description":"The Fleet Stack Pro Dashboard provides a powerful, comprehensive view of your fleet\u2019s performance. With key insights into vehicle status, health, and daily activity, the dashboard helps fleet managers monitor and optimize fleet operations. Here\'s a breakdown of its sections and features:","sidebar":"tutorialSidebar"},"Geofencing":{"id":"Geofencing","title":"Geofencing","description":"Geofencing is a powerful tool that allows you to create virtual boundaries around specific areas and receive alerts when a vehicle enters or exits these predefined zones. It\'s particularly useful for monitoring vehicle movements and ensuring fleet compliance with designated routes.","sidebar":"tutorialSidebar"},"Log-In":{"id":"Log-In","title":"Log In","description":"To access your Fleet Stack Pro account and manage your fleet, follow the simple steps to log in to the app. The login process is quick and ensures secure access to your account and the dashboard.","sidebar":"tutorialSidebar"},"Map-Features":{"id":"Map-Features","title":"Map and Features","description":"Fleet Stack Pro\u2019s map features provide you with a powerful tool to visualize and manage your fleet in real time. Access vehicle details, control actions remotely, and adjust map settings\u2014all from one place.","sidebar":"tutorialSidebar"},"Map-Settings":{"id":"Map-Settings","title":"Map and Features","description":"Fleet Stack Pro\u2019s map features provide you with a powerful tool to visualize and manage your fleet in real time. Access vehicle details, control actions remotely, and adjust map settings\u2014all from one place.","sidebar":"tutorialSidebar"},"Navigate":{"id":"Navigate","title":"Navigate","description":"The Navigate feature allows you to easily navigate to the current location of your vehicle using Google Maps. This is especially useful for fleet managers or drivers who need to quickly get directions to a vehicle\'s real-time location.","sidebar":"tutorialSidebar"},"Notifications-Settings":{"id":"Notifications-Settings","title":"Notification Settings","description":"The Notification Settings section lets you tailor your notification preferences to ensure you receive timely updates and alerts that matter most. From here, you can customize notification types, manage alerts, and ensure you\'re always in the loop. Access this section directly through the Settings menu.","sidebar":"tutorialSidebar"},"Parking-Mode":{"id":"Parking-Mode","title":"Parking Mode","description":"Parking Mode is a feature that allows you to receive notifications related to the status of your vehicles when they are parked. It helps you keep track of your fleet and ensures that no vehicle is left unattended or at risk.","sidebar":"tutorialSidebar"},"Remotely-Immobilize-Vehicle":{"id":"Remotely-Immobilize-Vehicle","title":"Remotely Immobilize Vehicle","description":"The Remotely Immobilize Vehicle feature allows you to control a vehicle\'s engine remotely, either starting or stopping it from a distance. This is especially useful for situations where you need to secure a vehicle or prevent unauthorized movement.","sidebar":"tutorialSidebar"},"Replay-Feature":{"id":"Replay-Feature","title":"Replay Feature","description":"The Replay Feature allows you to review the path traveled by a vehicle over a selected period. This feature is useful for monitoring vehicle routes, verifying locations, and understanding the movement of your fleet.","sidebar":"tutorialSidebar"},"Reports-and-Analysis":{"id":"Reports-and-Analysis","title":"Reports","description":"The Reports feature allows you to generate various reports related to your fleet\'s performance, vehicle activities, and more. These reports can help you analyze your fleet\u2019s data, identify trends, and make informed decisions for optimizing operations.","sidebar":"tutorialSidebar"},"Support-and-Feedback":{"id":"Support-and-Feedback","title":"Support and Feedback","description":"The Support and Feedback feature allows you to get assistance for any issues you\'re facing with the Fleet Stack Pro app, as well as provide valuable feedback to improve the service.","sidebar":"tutorialSidebar"},"Tracking-Link-Creation":{"id":"Tracking-Link-Creation","title":"Tracking Link Creation","description":"The Tracking Link Creation feature allows you to easily generate and share tracking links for your vehicles. This is useful for monitoring the location and status of vehicles in real time.","sidebar":"tutorialSidebar"},"Vehicle-Details":{"id":"Vehicle-Details","title":"Vehicle Details","description":"The Vehicle Details feature allows you to access specific information about each vehicle in your fleet.","sidebar":"tutorialSidebar"},"Vehicle-List-and-Details":{"id":"Vehicle-List-and-Details","title":"Vehicle List","description":"The Vehicle List allows you to access a comprehensive overview of all the vehicles in your fleet. Here are the features available for each vehicle in the list:","sidebar":"tutorialSidebar"}}}}')}}]);